import React from 'react';
import { NavLink } from 'react-router-dom';
const Error = () => {
    return 
    <>
    <div className="setStyles2">
        <h1> 404 Error Page</h1>
        <p>This page doesn't exist</p>
        <NavLink to = "/">Go Back</NavLink>
    </div>
    </>
};
export default Error;
